first mix all the dry ingredients together
Then mix the wet ingredients
Then gradually add the dry ingredients into the wet ingredients
Take a pan and grease it with oil or butter add the mixture into pan and bake it  at 180° for 40 - 45 minutes
Then decorate the cake as you like 
